import React from 'react';
import { Grid } from '@mui/material';
import { Typography } from '@mui/material';
import data from '../data.json';
import NewsCard from '../componentes/NewsCard';
import MatchCard from '../componentes/MatchCard';
import { Box, Card, CardContent } from "@mui/material";

export default function Home() {
  return (
    <Box sx={{ backgroundColor: "#f0f2f5", minHeight: "100vh", padding: 3 }}>
      <Typography variant="h3" gutterBottom>
        Noticias destacadas
      </Typography>
      
      <Grid container spacing={2} justifyContent="center">
        <Grid item xs={12} sm={6} md={4}>
          <Card sx={{ borderRadius: 2, boxShadow: 3, backgroundColor: "#ffffff" }}>
            <CardContent>
              <Typography variant="h6">
                Messi lidera a Argentina hacia la final de la Copa América
              </Typography>
            </CardContent>
          </Card>
        </Grid>
        {/* Agrega más tarjetas aquí según sea necesario */}
      </Grid>

      <Typography variant="h4" sx={{ marginTop: 4 }}>
        Estadísticas
      </Typography>
      
      <Grid container spacing={2} justifyContent="center">
        <Grid item xs={12} sm={6} md={4}>
          <Card sx={{ borderRadius: 2, boxShadow: 3, backgroundColor: "#ffffff" }}>
            <CardContent>
              <Typography variant="body1">Partidos Jugados</Typography>
              <Typography variant="body2">Fecha: 2024-06-25</Typography>
            </CardContent>
          </Card>
        </Grid>
        {/* Agrega más tarjetas aquí para estadísticas */}
      </Grid>
    </Box>
  );
}
